import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        String S1 = sc.next();
        String S2 = sc.next();
        long MOD = 1000000007;

        long ans = 1;
        int i = 0;

        if (S1.charAt(0) == S2.charAt(0)) {
            ans = 3;
            i = 1;
        } else {
            ans = 6;
            i = 2;
        }

        while (i < N) {
            if (S1.charAt(i) == S2.charAt(i)) {
                if (S1.charAt(i - 1) == S2.charAt(i - 1)) {
                    ans = (ans * 2) % MOD;
                } else {
                    ans = (ans * 1) % MOD;
                }
                i++;
            } else {
                if (S1.charAt(i - 1) == S2.charAt(i - 1)) {
                    ans = (ans * 2) % MOD;
                } else {
                    ans = (ans * 3) % MOD;
                }
                i += 2;
            }
        }

        System.out.println(ans);
        sc.close();
    }
}

