import java.util.PriorityQueue;
import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        long[] a = new long[3 * n];
        for (int i = 0; i < 3 * n; i++) {
            a[i] = sc.nextLong();
        }

        long[] maxLeft = new long[n + 1];
        PriorityQueue minHeap = new PriorityQueue<>();
        long currentSum = 0;

        for (int i = 0; i < 2 * n; i++) {
            currentSum += a[i];
            minHeap.add(a[i]);
            if (minHeap.size() > n) {
                currentSum -= minHeap.poll();
            }
            if (minHeap.size() == n) {
                maxLeft[i - n + 1] = currentSum;
            }
        }

        long[] minRight = new long[n + 1];
        PriorityQueue maxHeap = new PriorityQueue<>((x, y) -> Long.compare(y, x));
        currentSum = 0;

        for (int i = 3 * n - 1; i >= n; i--) {
            currentSum += a[i];
            maxHeap.add(a[i]);
            if (maxHeap.size() > n) {
                currentSum -= maxHeap.poll();
            }
            if (maxHeap.size() == n) {
                minRight[i - n] = currentSum;
            }
        }

        long maxScore = Long.MIN_VALUE;
        for (int i = 0; i <= n; i++) {
            maxScore = Math.max(maxScore, maxLeft[i] - minRight[i]);
        }

        System.out.println(maxScore);
        sc.close();
    }
}

