import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();

        long currentT = 1;
        long currentA = 1;

        for (int i = 0; i < N; i++) {
            long Ti = sc.nextLong();
            long Ai = sc.nextLong();

            long k = Math.max((currentT + Ti - 1) / Ti, (currentA + Ai - 1) / Ai);

            currentT = k * Ti;
            currentA = k * Ai;
        }

        System.out.println(currentT + currentA);
        sc.close();
    }
}

