import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);

        int N = sc.nextInt();
        long t = sc.nextInt();
        long a = sc.nextInt();

        for (int i = 1; i < N; i++) {
            long T = sc.nextInt();
            long A = sc.nextInt();

            long k1 = (t + T - 1) / T;
            long k2 = (a + A - 1) / A;
            long k = Math.max(k1, k2);

            t = T * k;
            a = A * k;
        }

        System.out.println(t + a);
    }
}

