import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();

        long takahashi = 0;
        long aoki = 0;

        for (int i = 0; i < N; i++) {
            long T = sc.nextLong();
            long A = sc.nextLong();

            if (i == 0) {
                takahashi = T;
                aoki = A;
            } else {
                long k = Math.max((takahashi + T - 1) / T, (aoki + A - 1) / A);
                takahashi = k * T;
                aoki = k * A;
            }
        }

        System.out.println(takahashi + aoki);
        sc.close();
    }
}

