    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        long x = sc.nextLong();
        long k = (x / 11) * 2;
        long rem = x % 11;
        if (rem > 0) {
            if (rem <= 6) {
                k += 1;
            } else {
                k += 2;
            }
        }
        System.out.println(k);
    }
