public class Main {
    public static void main(String[] args) {
        Scanner sc = new Scanner(System.in);
        int N = sc.nextInt();
        long t = 1, a = 1;

        for (int i = 0; i < N; i++) {
            int T = sc.nextInt();
            int A = sc.nextInt();

            long k = Math.max((t + T - 1) / T, (a + A - 1) / A);
            t = k * T;
            a = k * A;
        }

        System.out.println(t + a);
    }
}

